def parse_nested_parens(paren_string: str) -> List[int]:
    def count_parens(string: str) -> int:
        count = 0
        for char in string:
            if char == '(':
                count += 1
            elif char == ')':
                count -= 1
                if count < 0:
                    return -1
        return count

    def parse_group(string: str) -> List[int]:
        result = []
        for i, char in enumerate(string):
            if char == '(':
                result.append(count_parens(string[i+1:]))
            else:
                if result and result[-1] > 0:
                    result[-1] -= 1
                else:
                    result.append(count_parens(string[i:]))
        return result

    groups = paren_string.split(' ')
    result = []
    for group in groups:
        result.extend(parse_group(group))
    return result

def how_many_times(string: str, substring: str) -> int:
    count = 0
    index = 0
    while index < len(string):
        index = string.find(substring, index)
        if index == -1:
            break
        count += 1
        index += len(substring)
    return count

def fizz_buzz(n: int) -> int:
    count = 0
    for i in range(1, n):
        if i % 11 == 0 and i % 13 == 0:
            count += i % 7 == 7
        elif i % 11 == 0:
            count += i % 7 == 0
        elif i % 13 == 0:
            count += i % 7 == 0
    return count

def will_it_fly(q, w):
