def count_up_to(n):
    prime_numbers = []
    for i in range(2, int(n**0.5)+1):
        if all(i % p != 0 for p in prime_numbers):
            prime_numbers.append(i)
    return prime_numbers[:n]

def choose_num(x, y):
    num = x
    while num <= y:
        if num % 2 == 0:
            return num
        num += 1
    return -1

def count_nums(arr):
    count = 0
    for num in arr:
        digit_sum = sum(int(digit) for digit in str(num))
        if digit_sum > 0:
            count += 1
    return count

class Solution:
    def minSubArraySum(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        if not nums:
            return 0

        res = float('inf')
        prefix = 0
        for num in nums:
            prefix += num
            res = min(res , prefix)
        return res
def minSubArraySum(nums):
    return Solution().minSubArraySum(nums)

