def is_sorted(lst):
    if len(lst) <= 1:
        return True
    else:
        for i in range(len(lst) - 1):
            if lst[i] > lst[i + 1]:
                return False
        return True

def is_nested(string):
    stack = []
    for bracket in string:
        if bracket == "[":
            stack.append(bracket)
        elif bracket == "]":
            if not stack:
                return False
            top_bracket = stack.pop()
            if top_bracket != bracket:
                return False
    return not stack

def is_equal_to_sum_even(n):
    if n % 2 != 0:
        return False
    for i in range(2, int(n/2)+1):
        for j in range(i, int(n/2)+1):
            for k in range(j, int(n/2)+1):
                if k > i:
                    for l in range(k, n):
                        if l % 2 == 0:
                            if i + j + k + l == n:
                                return True
    return False

def x_or_y(n, x, y):
    """A simple program which should return the value of x if n is 
    a prime number and should return the value of y otherwise.

    Examples:
    for x_or_y(7, 34, 12) == 34
    for x_or_y(15, 8, 5) == 5

    """
    if n % 2 == 0:
        return y
    else:
        for i in range(3, int(n**0.5) + 1, 2):
            if n % i == 0:
                return y
        return x

class Solution:
    def intToMiniRoman(self, num: int) -> str:
        int_to_mini_roman_map = {
            1000: 'm',
            900: 'cm',
            500: 'd',
            400: 'cd',
            100: 'c',
            90: 'xc',
            50: 'l',
            40: 'xl',
            10: 'x',
            9: 'ix',
            5: 'v',
            4: 'iv',
            1: 'i'
        }

        roman_numeral = ''
        for value, symbol in int_to_mini_roman_map.items():
            while num >= value:
                num -= value
                roman_numeral += symbol
        return roman_numeral.lower()
def int_to_mini_roman(number):
    return Solution().intToMiniRoman(number)
